precision highp float;
uniform sampler2D texture;
in vec2 v_uv0;
in vec4 v_light;
#if USE_TINT
  in vec4 v_dark;
#endif
uniform myData{
  vec4 hitColor;
};
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
void main () {
  vec4 texColor = vec4(1.0);
  vec4 texture_tmp = texture(texture, v_uv0);
  #if CC_USE_ALPHA_ATLAS_texture
      texture_tmp.a *= texture(texture, v_uv0 + vec2(0, 0.5)).r;
  #endif
  #if INPUT_IS_GAMMA
    texColor.rgb *= (texture_tmp.rgb * texture_tmp.rgb);
    texColor.a *= texture_tmp.a;
  #else
    texColor *= texture_tmp;
  #endif
  vec4 finalColor = vec4(1, 1, 1, 1);
  finalColor.rgb = mix(texColor.rgb, hitColor.rgb, (1.0-v_light.a)*texColor.a);
  finalColor.a = texColor.a*1.0;
  gl_FragColor = finalColor;
}

